import './App.css';

function roundRect() {
  return (
    <div style = {{
      width: '200px',
      height: '100px',
      backgroundColor: 'red',
      borderRadius: '15px' 
    }}>
      This is a rounded rectangle.
    </div>
  )
}

function App() {
  return (
    <div className="App">
      <roundRect />
      <p>How</p>
    </div>
  );
}

export default App;
